import React from "react";
import logo from "./Logo-w.png"
import "./Home.css"


function Home(){
    return(
        <>
            <div className="body--flex--home">
            <div className="home--background">
        <h1>Bestellijst D&B Studio</h1>
        <img src={logo} alt="Logo D&B"/>
            </div>
            </div>
        </>
    )
}

export default Home;
